function MovieItem(props) {
    return (<div>
        {
            props.movie.map((singleContact, index) => {
                // Ein Key ist ein Einzigartiger Wert, z.B eine id
                return (<div className="contactCard">
                    <p>{props.name}</p>s
                    <p>{props.tel}</p>
                </div>);
            })}
    </div>);
}

export default MovieItem;
